                <img width="100%" src="/images/holder_2.jpg" alt="" />
            </Grid>
            <Grid item xs={6} sm={4} md={3}>
                <img width="100%" src="/images/holder_2.jpg" alt="" />
            </Grid>

            <Grid item xs={6} sm={4} md={3}>
                <img width="100%" src="/images/holder_2.jpg" alt="" />
            </Grid>
            <Grid item xs={6} sm={4} md={3}>
                <img width="100%" src="/images/holder_2.jpg" alt="" />
            </Grid>
            <Grid item xs={6} sm={4} md={3}>
                <img width="100%" src="/images/holder_2.jpg" alt="" />
            </Grid>
            <Grid item xs={6} sm={4} md={3}>
                <img width="100%" src="/images/holder_2.jpg" alt="" />
            </Grid>
        </Grid>
        </>
    )
}

export default ProductCategoryList
